  input: TEXT,F3XA,,"This letter is in response to questions raised in your letter
    dated May 14, 2003.  We have reviewed our records with respect to Line 23 and
    the separate Schedule B, pages 155-158/158 supporting Line 23, Contributions to
    Federal Candidates/Committees and Other Political Committees.  On page 158/158
    three non-candidate operating expenditures were inadvertently reported/combined
    with Contributions to Federal Candidates.  We have amended Line 23 and Line 21(b)
    of the Detailed Summary Page and the corresponding Schedule B to show the operating
    expenditures on the correct line.  We have also reviewed our records with respect
    to Other Federal Operating Expenditures shown on the Detailed Summary Page, Line
    21(b) in the amount $1,041.44.  This amount is supported by disclosure on separate
    Schedule B, pages 152 & 153/158.  We have amended Schedule B, pages 152&153/158
    to indicate the purpose and category type of these disbursements.  The expenditures
    represent bank service charges incurred by the committee on federal accounts."
